import React,{Component} from 'react';
import {Grid, Card, CardHeader, CardIcon} from '@material-ui/core';
import {DriveEta, LocalHospital} from '@material-ui/icons';

class InsuranceCard extends Component{

    render(){
        return <Grid item xs = {4}>
            <Card>
                {this.getCardHeader()}
            </Card>
        </Grid>
    }

    getCardHeader = () => {
        return <CardHeader color = "warning">

        </CardHeader>
    }

    getCardIcon = () => {
        return <CardIcon>

        </CardIcon>
    }

}

export default InsuranceCard;
